import React, { Component } from 'react';

class Snacks extends Component {

  render() {
    return (
      <div>
        <ul>
          {this.props.snacks.map(snack => <p>{snack.name}</p>)}
        </ul>
      </div>
    );
  }

}

export default Snacks;
